import React from 'react';
import './Items.css';


function Items(props) {
    return (
      <div className="addnew-item">
          <div className="todo-item-date">
          {console.log(props)}

          </div>
          <span className="delete-btn" title="delete" onClick={(e) => {
              e.stopPropagation();
              props.onDeleteItem(props.item);
          }}></span>
      </div>
    );
}

export default Items;
